      .brand--head, .brand--head *   { font-family: 'Roboto' !important; }
      .brand--body, .brand--body *   { font-family: 'Merriweather' !important; }
      .brand--lhead, .brand--lhead * { font-family: 'Roboto' !important; }
      .brand--lbody, .brand--lbody * { font-family: 'Merriweather' !important; }
      .brand--ui, .brand--ui *       { font-family: 'Lato' !important; }

      .brand--beforeHead:before { font-family: 'Roboto' !important; }
      .brand--afterHead:after { font-family: 'Roboto' !important; }

      .brand--background        { background-color: #f8be15 !important; }
      .brand--background-all *  { background-color: #f8be15 !important; }
      .brand--border            { border-color: #f8be15 !important; }
      .brand--color             { color: #f8be15 !important; }
      .brand--color-all *       { color: #f8be15 !important; }
      .brand--shadow            { box-shadow: 0 0 0 0.2rem #f8be15 !important; }
      .brand--shadow-all *      { box-shadow: 0 0 0 0.2rem #f8be15 !important; }
      .brand--fill              { fill: #f8be15 !important; }
      .brand--stroke            { stroke: #f8be15 !important; }

      .brand--beforeBackground:before { background-color: #f8be15 !important; }
      .brand--beforeBorder:before     { border-color: #f8be15 !important; }
      .brand--beforeColor:before      { color: #f8be15 !important; }

      .brand--afterBackground:after { background-color: #f8be15 !important; }
      .brand--afterBorder:after     { border-color: #f8be15 !important; }
      .brand--afterColor:after      { color: #f8be15 !important; }

      /* should be applied to containers where links
         need to appear in brand color */
      .brand--linkColor a { color: #f8be15 !important; }

      /* should be applied to containers where links
         need to change to brand color on hover */
      .brand--linkColorHover a:hover { color: #f8be15 !important; }

      /* should be applied to any single element that
         needs to change color on hover */
      .brand--hoverColor:hover { color: #f8be15 !important; }

      /* TODO: probably need a way to create a 5-10% darker/lighter color */
      .brand--linkColor a:hover,
      .button.brand--background:hover { opacity: .65 !important; }

      @media (min-width: 47.9375em) { /* 768px */
        .brand--min768--background { background-color: #f8be15 !important; }
        .brand--min768--border     { border-color: #f8be15 !important; }
        .brand--min768--color      { color: #f8be15 !important; }
      }

      @media (max-width: 47.9375em) { /* 768px */
        .brand--max768--background { background-color: #f8be15 !important; }
        .brand--max768--border     { border-color: #f8be15 !important; }
        .brand--max768--color      { color: #f8be15 !important; }
      }
